import React from 'react';
import {View, SafeAreaView, Text, StyleSheet, TextInput, FlatList, Image, ScrollView, TouchableOpacity} from 'react-native';
import { RadioButton } from 'react-native-paper';
import Icon2  from 'react-native-vector-icons/AntDesign';
import styled from 'styled-components/native';


const StyledCard1= styled.Image`
width: 85.33px;
height: 48px;
border: 1px solid #000000;
filter: drop-shadow(0px 4px 4px rgba(0, 0, 0, 0.25));
`;

const CardView= styled.View`
flex-direction: row;
align-items: center;
justify-content: space-around;
`;

const Head= styled.Text`
  
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 14px;
line-height: 28px;
letter-spacing: -0.333333px;
color: #C3AD60;
`;


export default function Ecommerce8({navigation}){
	return(
		<SafeAreaView style={styles.container}>
		<Head>Saved Cards</Head>
		<CardView><StyledCard1 source={require('../assets/card1.png')}/><StyledCard1 source={require('../assets/card2.png')}/><StyledCard1 source={require('../assets/card3.png')}/></CardView>
		</SafeAreaView>
		)
}

const styles=StyleSheet.create({
	container:{
		backgroundColor:'#000',
		flex:1,

	},

})
